No matter the temperature, I'm a hot coffee-in-the-morning kind of person. BUT once I pass the threshold of being awake and want to sustain my energy through the day, I become an iced coffee person. A chill weekend brunch at home with my wife is made simple and complete with Nespresso ❄️☕️

@nespressousa #WithNespresso #ad

*no recipes - sorry :) Soft scramble with chèvre, arugula salad, sourdough & butter for me. A whipped feta, burst tomato, olive, honey, and basil toast for her ❤️😍
